using Consist.Doxi.Domain.Models;
using Consist.Doxi.Enums;
using Microsoft.Extensions.Configuration;
using NUnit.Framework;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Threading.Tasks;

namespace Doxi.APIClient.Tests
{
    public class FlowsTests
    {
        private IDoxiClient _doxiClient;
        [SetUp]
        public void Setup()
        {
            var builder = new ConfigurationBuilder()
                .AddUserSecrets<FlowsTests>();

            var configuration = builder.Build();

            _doxiClient = new DoxiClient(
                configuration["idpUrl"],
                configuration["serviceUrl"],
                configuration["CompanyName"],
                configuration["UserName"],
                configuration["Password"]);
        }

        [Test]
        public async Task GetAllFlows_Test()
        {
            var result = await _doxiClient.GetAllFlows();
        }
        [Test]
        public async Task AddAttachmentToFlow_Test()
        {
            var pdfFile = File.ReadAllBytes(Path.Combine(Directory.GetCurrentDirectory(), "emptyPDF.pdf"));

            var result = await _doxiClient.AddAttachmentToFlow(
                new AddAttachmentToFlowRequest()
                {
                    File = new FileData
                    {
                        FileBytes = pdfFile,
                        Name = "test",
                    },
                    SignFlowId = "397174cc-400f-4c9d-a188-3a1399d1500b",
                    UserAddedTheFile = new ParticipantKey<ParticipantKeyType>()
                    {
                        Key = "doxi_service@metro.co.il",
                        Type = ParticipantKeyType.UserEmail
                    }
                });
        }

        [Test]
        public async Task AddSignFlow_Test()
        {
            var pdfFile = File.ReadAllBytes(Path.Combine(Directory.GetCurrentDirectory(), "emptyPDF.pdf"));
            var result = await _doxiClient.AddSignFlow(new ExCreateFlowRequestBase
            {
                Description = "Test flow",
                SenderKey = new ParticipantKey<ParticipantKeyType>
                {
                    Type = ParticipantKeyType.UserEmail,
                    Key = "ronenr@consist.co.il"
                },
                DocumentFileName = "testPDF.pdf",
                FlowElements = new[]
                {
                    new ExFlowElement
                    {
                        PageNumber = 1,
                        Position = new ElementPosition
                        {
                            Top = 0,
                            Left = 0,
                            Height = 50,
                            Width = 100,
                        },
                        SignerKey = new ParticipantKey<ParticipantKeyType>
                        {
                            Type = ParticipantKeyType.UserEmail,
                            Key = "john@someDomain.com"
                        },
                        ElementType = ElementType.Sign
                    }
                },
                Users = new[]
                {
                    new ExUser
                    {
                        Email = "john@someDomain.com",
                        FirstName = "John",
                        LastName = "Doe"
                    }
                }
            }, pdfFile);
        }

        [Test]
        public async Task GetDocument_Test()
        {
            var allFlows = await _doxiClient.GetAllFlows();
            var result = await _doxiClient.GetDocument(allFlows.SignFlowsIds.First(), true);
            File.WriteAllBytes(Path.Combine(Directory.GetCurrentDirectory(), "result.pdf"), result);
        }

        [Test]
        public async Task GetFlow_Test()
        {
            var result = await _doxiClient.GetFlow("d779d333-cbb6-4e5f-a53d-5323c27ca389");
        }

        [Test]
        public async Task SearchFlow_Test()
        {
            var result = await _doxiClient.SearchFlow(new GetFlowsByFilterRequest
            {
                CustomFields = new[]
                {
                    new KeyValuePair<string,string>("key","0524477666"),
                    new KeyValuePair<string,string>("value","2")
                },
                SignatureFlowStatus = 0
            });
        }

        [Test]
        public async Task GetFlowsStatus_Test()
        {
            var result = await _doxiClient.GetFlowsStatus(new GetFlowsStatusRequest
            {
                SignFlowsIds = new[]
                {
                    "99add5fd-e0f7-495d-a85a-14e5de92f60f"
                }
            });
        }

        [Test]
        public async Task GetFlowStatus_Test()
        {
            var result = await _doxiClient.GetFlowStatus("99add5fd-e0f7-495d-a85a-14e5de92f60f");
        }

        [Test]
        public async Task SetFlowAction_Test()
        {
            var allFlows = await _doxiClient.GetAllFlows();
            var flowActionRequest = new SetFlowActionRequest
            {
                FlowAction = FlowExternalAction.ArchiveFlow,
                UserKey = new ParticipantKey<ParticipantKeyType>
                {
                    Key = "dudim@consist.co.il",
                    Type = ParticipantKeyType.UserEmail
                },
                IsRecover = true,
                SignerKey = new ParticipantKey<ParticipantKeyType>
                {
                    Key = "dudim@consist.co.il",
                    Type = ParticipantKeyType.UserEmail
                }
            };
            var result = _doxiClient.SetFlowAction(allFlows.SignFlowsIds.First(), flowActionRequest);
        }

        [Test]
        public async Task SetSignatures_Test()
        {
            var allFlows = await _doxiClient.GetAllFlows();
            var signFlowRequest = new ExSetSignFlowRequest
            {
                SignerKey = new ParticipantKey<ParticipantKeyType>
                {
                    Key = "dudim@consist.co.il",
                    Type = ParticipantKeyType.UserEmail
                },
                DeclineComments = "no",
                SignAction = SignAction.Approve,
                SignImageBase64 = "data:image/png;base64,",
                BrowserDetails = "",
                IPAddress = "10.10.110.18",
                FlowElements = new[]
                {
                    new FlowElementData
                    {
                        ElementId = "42",
                        TextData = ""
                    }
                },
                AttachedFiles = new[]
                {
                    ""
                }
            };
            var result = _doxiClient.SetSignatures(allFlows.SignFlowsIds.First(), signFlowRequest);
        }

        [Test]
        public async Task ReplaceSigner_Test()
        {
            var exReplaceSignerRequest = new ExReplaceSignerRequest
            {
                CurrentSignerKey = new ParticipantKey<ParticipantKeyType>()
                {
                    Key = "ddacfedb-213a-4033-989e-3339089117a8",
                    Type = ParticipantKeyType.UserId
                },
                NewtSigner = new ExUser()
                {
                    UserKey = new ParticipantKey<ParticipantKeyType>()
                    {
                        Key = "chenl@consist.co.il",
                        Type = ParticipantKeyType.UserEmail
                    },
                    Email = "chenl@consist.co.il",
                    FirstName = "Chen",
                },
                signFlowsId = new[] { "d779d333-cbb6-4e5f-a53d-5323c27ca389" },
            };
            await _doxiClient.ReplaceSigner(exReplaceSignerRequest);
        }

    }

}